import React from "react";
function Home() {
    return (
        <>
            <div className="content" style={{ paddingTop: '40px', paddingLeft: '20px', paddingRight: '20px' }}>
                <h1>Welcome to the Website</h1>
                <p>This is the main content area.</p>
            </div>
            <h1>kaushik</h1>
        </>
    )
}
export default Home;
